import React, { Component } from "react";

class User extends Component {
  componentDidMount() {
    this.props.getSingleGithubUser(this.props.match.params.login);
  }

  render() {
    // github response, pull out that data -> e.g. https://api.github.com/users/eder13
    const {
      name,
      avatar,
      url,
      location,
      bio,
      blog,
      login,
      html_url,
      followers,
      following,
      public_repos,
      public_gists,
      hireable,
    } = this.props.user;

    console.log(name);

    return <div>{name}</div>;
  }
}

export default User;
